import { Link } from "react-router-dom";

export const HomeCatalogItem = () => {
       return (
       <div className="col-lg-3 col-md-6 col-sm-12 col-xs-12">
       <div className="blog-box">
           <div className="post-media">
               <a href="food-single.html" title="">    
                   <span className="detail veg">Veg</span>
                   <img src="styles/upload/blog_square_10.jpg" alt="" className="img-fluid"/>
                   <div className="hovereffect"></div>
               </a>
           </div> {/* <!-- end media --> */}

           <div className="blog-meta big-meta">
               <div className="rating">
                   <i className="fa fa-star"></i>
                   <i className="fa fa-star"></i>
                   <i className="fa fa-star"></i>
                   <i className="fa fa-star"></i>
                   <i className="fa fa-star"></i>
               </div>
               <h4><Link to="/details" title="">Eggplant meat broth </Link></h4>
               <p>Aenean interdum arcu blandit, vehicula magna non, placerat et pharetratortor.</p>
               <small><a href="food-single.html" title="">18 July, 2017</a></small>
               <small><a href="#" title="">by Matilda</a></small>
           </div> {/* <!-- end meta --> */}
       </div> {/* <!-- end blog-box --> */}
       <hr class="invis3"/>
   </div>
   ); 
}
